import React from 'react'
import axios from 'axios';

import ModelCard from './ModelCard'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Button from 'react-bootstrap/Button'
import CloseButton from 'react-bootstrap/CloseButton'
import ExampleButton from './show_example/ExampleButton'

const ModelsCards = ({modelsData, onModelSelection}) => {
    const handleModelSelection = (modelId) => {
        console.log(modelId)
        onModelSelection(modelId)
    }
    return (
        <div style={{textAlign: 'center'}}>
            <Row xs={1} md={2} lg={3} style={{textAlign: 'center'}}>
            {modelsData.map((modelData, idx) => (
                <Col>
                    <ModelCard
                        fileName={modelData['file_name']} 
                        dataTime={modelData['datetime']} 
                        featuresNames={modelData['features']}
                        onClick={() => handleModelSelection(modelData['id'])}
                    />
                </Col>
            ))}
            </Row>
        </div>
    )
}

export default ModelsCards
